import './App.scss';
import 'bulma';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Home from './components/Home/Home';
import Faq from './components/Faq/Faq';
import { BrowserRouter as Router, Link, Route, NavLink, Switch } from 'react-router-dom';

// const Faq = () => (
//   <>
//     <h3>FAQ</h3>
//   </>
// );

// const Home = () => (
//   <>
//     <h3>Home</h3>
//   </>
// );

function App() {
  return (
    <div className="App">
      <nav className="navbar is-dark" role="navigation" aria-label="main navigation">
        <div className="navbar-brand">
          <button id="brand" className="button is-dark is-medium">MyCompany</button>
          <a role="button" class="navbar-burger" aria-label="menu" aria-expanded="false" data-target="navbarBasicExample">
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
          </a>
        </div>

        <div id="navbarBasicExample" className="navbar-menu">
          <div className="navbar-end">
                            <Router>
                                <Link to='/' className="navbar-item">Home</Link>
                                <Link to='/faq' className="navbar-item">Features</Link>
                                <Link to='/faq' className="navbar-item">About</Link>
                                <Link to='/faq' className="navbar-item">FAQ</Link>
                                <Route exact path="/" component={Home}></Route>
                                <Route path="/faq" component={Faq}></Route>
                            </Router>

                            <div className="navbar-item">
                            <div className="buttons">
                            <button className="button is-primary is-outlined">
                                <span className="icon">
                                <i className="fa fa-download"></i>
                                </span>
                                <span>Join Now</span>
                            </button>
                            </div>
                        </div>
                    </div>
                </div>
                </nav>      
      <Router>
        <Switch>
          <Route exact path="/" component={Home}></Route>
          <Route path="/faq" component={Faq}></Route>
        </Switch>
      </Router>
      {/* <Switch>
        <Route exact path="/" component={Home}></Route>
        <Route path="/faq" component={Faq}></Route>
      </Switch> */}

      <Footer></Footer>
    </div>
  );
}

export default App;
